import React from 'react';
import Head from './Head';

const Sobre = () => {
  return (
    <div>
      <Head title="Sobre" description="Está é a página sobre" />
      <h1>Sobre</h1>
      <p>Essa é a página sobre</p>
    </div>
  );
};

export default Sobre;
